import './App.css';
import { Routes, Route} from 'react-router-dom'
import { Home } from './pages/landingpublic'
import { JobAvailable } from './pages/jobavailable'
import { ApplyJob } from './pages/applyjob'
import { Login } from './pages/login'
import Nav from 'react-bootstrap/Nav'
import Container from 'react-bootstrap/Container'
import Navbar from 'react-bootstrap/Navbar'

function App() {
  return (
    //router for the pages
    <>
    <Navi />
    {/* <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/jobavailable" element={<JobAvailable />} />
      <Route path="/applyjob" element={<ApplyJob />} />
      <Route path="/login" element={<Login/>} />
    </Routes> */}
    </>
  );
}

function Navi() {
  return (
    <Navbar bg="dark" variant="dark" expand="lg">
      <Container>
      <Navbar.Brand href="/">Corp U University</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav>
          <Nav.Link href="/">Home</Nav.Link>
          <Nav.Link href="/jobavailable">Job Available</Nav.Link>
          <Nav.Link href="/applyjob">Apply Job</Nav.Link>
          <Nav.Link href="/login">Login</Nav.Link>
        </Nav>
      </Navbar.Collapse>
      </Container>
    </Navbar>

  )
}

export default App;
